func testSeqhashToOneSeqhashUsingTranslationSeqhash(t *testing.T) {
	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var local Seqhash
	var foreign Seqhash

	seed := randomize.NewSeed()
	if err := randomize.Struct(seed, &local, seqhashDBTypes, true, seqhashColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize Seqhash struct: %s", err)
	}
	if err := randomize.Struct(seed, &foreign, seqhashDBTypes, false, seqhashColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize Seqhash struct: %s", err)
	}

	if err := foreign.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	queries.Assign(&local.Translation, foreign.Seqhash)
	if err := local.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	check, err := local.TranslationSeqhash().One(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}

	if !queries.Equal(check.Seqhash, foreign.Seqhash) {
		t.Errorf("want: %v, got %v", foreign.Seqhash, check.Seqhash)
	}

	slice := SeqhashSlice{&local}
	if err = local.L.LoadTranslationSeqhash(ctx, tx, false, (*[]*Seqhash)(&slice), nil); err != nil {
		t.Fatal(err)
	}
	if local.R.TranslationSeqhash == nil {
		t.Error("struct should have been eager loaded")
	}

	local.R.TranslationSeqhash = nil
	if err = local.L.LoadTranslationSeqhash(ctx, tx, true, &local, nil); err != nil {
		t.Fatal(err)
	}
	if local.R.TranslationSeqhash == nil {
		t.Error("struct should have been eager loaded")
	}
}

